import React from "react";

const UserTable = ({ users }) => {
  console.log(users);
  return (
    <>
      <h2>{users.length} Sonuç Bulundu</h2>
      <table className="">
        <thead>
          <tr>#</tr>
          <tr>İsim</tr>
          <tr>Soyisim</tr>
          <tr>Boy</tr>
          <tr>Kilo</tr>
          <tr>Kan Grubu</tr>
        </thead>
        <tbody>
          {users.map((user) => (
            <tr key={user.id}>
              <th>{user.id}</th>
              <td>{user.firstName}</td>
              <td>{user.lastName}</td>
              <td>{user.firstName}</td>
              <td>{user.firstName}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </>
  );
};

export default UserTable;
